This video will take you step by step thru the Jmod Process. By performing the JMOD to your Ford vehicle's transmission, you will increase the speed of the gears, and the reliability of your 4r70w. This transmission is found in vehicles such as Ford Mustang, Ford Crown Victoria, Mercury Grand Marquis, Lincoln Town Car, Lincoln Mark VIII, Mercury Cougar, Ford Thunderbird, Ford F150, Ford Bronco, etc.


Please research your own drill bit sizes and fluid capacities on either Crownvic.net or TCCOA.com.


